register.text:
if (form.$invalid) {
          var template = '';
          if (form.$error.required) {
            template = '请完善输入';
          }
          else {
            template = '请检查输入';
          }

          $ionicLoading.show({
            template: template,
            duration: 1400,
            noBackdrop: true,
          })
        }
